public class Solution {
    public int[] earliestAndLatest(int n, int firstPlayer, int secondPlayer) {
        if (firstPlayer > secondPlayer) {
            int temp = firstPlayer;
            firstPlayer = secondPlayer;
            secondPlayer = temp;
        }

        int minRound = Integer.MAX_VALUE;
        int maxRound = 0;

        for (int i = 1; i <= n / 2; i++) {
            if ((firstPlayer - 1) < i && (n - secondPlayer) < i) {
                continue;
            }

            int round = 1;
            int left = firstPlayer;
            int right = secondPlayer;

            while (left != right) {
                round++;
                if ((left - 1) >= i) {
                    left -= i;
                }
                if ((n - right) >= i) {
                    right += i;
                }

                if (right > n / 2 && n % 2 == 0) {
                    break;
                } else if (right > (n + 1) / 2 && n % 2 != 0) {
                    break;
                }
            }

            minRound = Math.min(minRound, round);
            maxRound = Math.max(maxRound, round);
        }

        return new int[] {minRound, maxRound};
    }
}

