public class Solution {
    private static final int MOD = (int) 1e9 + 7;

    public int makeStringSorted(String s) {
        char[] chars = s.toCharArray();
        int count = 0;

        while (!isSorted(chars)) {
            int i = findLargestIndex(chars);
            if (i == -1) break;

            int j = findLargestJ(chars, i);
            swap(chars, i - 1, j);
            reverseSuffix(chars, i);
            count++;
        }

        return count % MOD;
    }

    private boolean isSorted(char[] chars) {
        for (int i = 1; i < chars.length; i++) {
            if (chars[i] < chars[i - 1]) return false;
        }
        return true;
    }

    private int findLargestIndex(char[] chars) {
        for (int i = chars.length - 1; i > 0; i--) {
            if (chars[i] < chars[i - 1]) return i;
        }
        return -1;
    }

    private int findLargestJ(char[] chars, int i) {
        for (int j = chars.length - 1; j >= i; j--) {
            boolean allLessThan = true;
            for (int k = i; k <= j; k++) {
                if (chars[k] >= chars[i - 1]) {
                    allLessThan = false;
                    break;
                }
            }
            if (allLessThan) return j;
        }
        return -1;
    }

    private void swap(char[] chars, int i, int j) {
        char temp = chars[i];
        chars[i] = chars[j];
        chars[j] = temp;
    }

    private void reverseSuffix(char[] chars, int i) {
        int left = i;
        int right = chars.length - 1;

        while (left < right) {
            swap(chars, left, right);
            left++;
            right--;
        }
    }
}

