public class Solution {
    public int[] findingUsersActiveMinutes(int[][] logs, int k) {
        Map<Integer, Set<Integer>> userToTime = new HashMap<>();

        for (int[] log : logs) {
            int userId = log[0];
            int time = log[1];

            if (!userToTime.containsKey(userId)) {
                userToTime.put(userId, new HashSet<>());
            }

            userToTime.get(userId).add(time);
        }

        int[] answer = new int[k];

        for (Set<Integer> times : userToTime.values()) {
            int uam = times.size();

            if (uam <= k) {
                answer[uam - 1]++;
            }
        }

        return answer;
    }
}

