public class Solution {
    public int[] closestRoom(int[][] rooms, int[][] queries) {
        Arrays.sort(rooms, (a, b) -> b[1] - a[1]);

        int k = queries.length;
        int[] ans = new int[k];

        for (int i = 0; i < k; i++) {
            int preferred = queries[i][0], minSize = queries[i][1];
            int closestRoomId = -1, minDiff = Integer.MAX_VALUE;

            for (int[] room : rooms) {
                if (room[1] >= minSize) {
                    int diff = Math.abs(room[0] - preferred);
                    if (diff < minDiff || (diff == minDiff && (closestRoomId == -1 || room[0] < closestRoomId))) {
                        minDiff = diff;
                        closestRoomId = room[0];
                    }
                }
            }

            ans[i] = closestRoomId;
        }

        return ans;
    }
}

