public class Solution {
    public int minSwaps(String s) {
        int n = s.length();
        int ones = 0, zeros = 0;

        // count the number of ones and zeros in the string
        for (char c : s.toCharArray()) {
            if (c == '1') {
                ones++;
            } else {
                zeros++;
            }
        }

        // if the difference between the counts is more than 1, it's impossible to make the string alternating
        if (Math.abs(ones - zeros) > 1) {
            return -1;
        }

        int swaps = 0;

        // try to make the string start with '0'
        char[] arr = s.toCharArray();
        for (int i = 0; i < n; i++) {
            if ((i % 2 == 0 && arr[i] != '0') || (i % 2 == 1 && arr[i] != '1')) {
                // find the next character that should be at this position
                for (int j = i + 1; j < n; j++) {
                    if ((i % 2 == 0 && arr[j] == '0') || (i % 2 == 1 && arr[j] == '1')) {
                        // swap the characters
                        char temp = arr[i];
                        arr[i] = arr[j];
                        arr[j] = temp;
                        swaps++;
                        break;
                    }
                }
            }
        }

        int swaps2 = 0;

        // try to make the string start with '1'
        arr = s.toCharArray();
        for (int i = 0; i < n; i++) {
            if ((i % 2 == 0 && arr[i] != '1') || (i % 2 == 1 && arr[i] != '0')) {
                // find the next character that should be at this position
                for (int j = i + 1; j < n; j++) {
                    if ((i % 2 == 0 && arr[j] == '1') || (i % 2 == 1 && arr[j] == '0')) {
                        // swap the characters
                        char temp = arr[i];
                        arr[i] = arr[j];
                        arr[j] = temp;
                        swaps2++;
                        break;
                    }
                }
            }
        }

        // return the minimum number of swaps
        if (swaps > 0 && swaps2 > 0) {
            return Math.min(swaps, swaps2);
        } else if (swaps > 0) {
            return swaps;
        } else if (swaps2 > 0) {
            return swaps2;
        } else {
            // if no swaps were needed, the string is already alternating
            return 0;
        }
    }
}

