public class Solution {
    public int maxHappyGroups(int batchSize, int[] groups) {
        Arrays.sort(groups);
        Map<Integer, Integer> map = new HashMap<>();
        for (int group : groups) {
            map.put(group % batchSize, map.getOrDefault(group % batchSize, 0) + 1);
        }

        int happyGroups = 0;
        if (map.containsKey(0)) {
            happyGroups += map.get(0);
            map.remove(0);
        }

        for (int remainder : map.keySet()) {
            while (map.get(remainder) > 0 && map.containsKey(batchSize - remainder)) {
