import java.util.Arrays;
import java.util.Comparator;

public class Solution {
    public int maxBuilding(int n, int[][] restrictions) {
        Arrays.sort(restrictions, Comparator.comparingInt(a -> a[0]));

        for (int i = 1; i < restrictions.length; i++) {
            int prevId = restrictions[i - 1][0];
            int prevMaxHeight = restrictions[i - 1][1];
            int currId = restrictions[i][0];
            int currMaxHeight = restrictions[i][1];

            if (prevMaxHeight + (currId - prevId) > currMaxHeight) {
                restrictions[i][1] = Math.min(currMaxHeight, prevMaxHeight + (currId - prevId));
            }
        }

        for (int i = restrictions.length - 2; i >= 0; i--) {
            int nextId = restrictions[i + 1][0];
            int nextMaxHeight = restrictions[i + 1][1];
            int currId = restrictions[i][0];
            int currMaxHeight = restrictions[i][1];

            if (nextMaxHeight + (nextId - currId) > currMaxHeight) {
                restrictions[i][1] = Math.min(currMaxHeight, nextMaxHeight + (nextId - currId));
            }
        }

        int maxBuildingHeight = 0;

        for (int i = 0; i < restrictions.length; i++) {
            if (i == 0) {
                maxBuildingHeight = Math.max(maxBuildingHeight, restrictions[i][1]);
            } else {
                int prevId = restrictions[i - 1][0];
                int prevMaxHeight = restrictions[i - 1][1];
                int currId = restrictions[i][0];
                int currMaxHeight = restrictions[i][1];

                maxBuildingHeight = Math.max(maxBuildingHeight, (prevMaxHeight + currMaxHeight) / 2 + ((currId - prevId) / 2));
            }
        }

        if (n > restrictions[restrictions.length - 1][0]) {
            int lastRestrictionId = restrictions[restrictions.length - 1][0];
            int lastRestrictionMaxHeight = restrictions[restrictions.length - 1][1];

            maxBuildingHeight = Math.max(maxBuildingHeight, lastRestrictionMaxHeight + (n - lastRestrictionId));
        }

        return maxBuildingHeight;
    }
}

