import java.util.Arrays;
import java.util.Comparator;

public class Solution {
    public int[] minInterval(int[][] intervals, int[] queries) {
        int n = queries.length;
        Integer[] queryIndices = new Integer[n];
        for (int i = 0; i < n; i++) {
            queryIndices[i] = i;
        }

        Arrays.sort(queryIndices, Comparator.comparingInt(a -> queries[a]));
        Arrays.sort(intervals, Comparator.comparingInt(a -> a[0]));

        int[] result = new int[n];
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> {
            if (a[1] == b[1]) return Integer.compare(b[2], a[2]);
            else return Integer.compare(a[1], b[1]);
        });

        int j = 0;
        for (int i : queryIndices) {
            while (j < intervals.length && intervals[j][0] <= queries[i]) {
                pq.offer(new int[] {intervals[j][0], intervals[j][1], intervals[j][1] - intervals[j][0] + 1});
                j++;
            }

            while (!pq.isEmpty() && pq.peek()[1] < queries[i]) {
                pq.poll();
            }

            if (pq.isEmpty()) result[i] = -1;
            else result[i] = pq.peek()[2];
        }

        return result;
    }
}

