public class Solution {
    public int maxValue(int n, int index, int maxSum) {
        int left = 0;
        int right = maxSum - n + 1;

        while (left < right) {
            int mid = left + (right - left + 1) / 2;
            if (check(mid, n, index, maxSum)) {
                left = mid;
            } else {
                right = mid - 1;
            }
        }

        return left;
    }

    private boolean check(int x, int n, int index, int maxSum) {
        long sum = x;

        if (x > index + 1) {
            sum += (long)(x - (index + 1)) * (x - (index + 1) + 1) / 2;
        }

        if (n - index - 1 >= x) {
            return sum <= maxSum;
        } else {
            sum += (long)(n - index - 1) * ((n - index - 1) + 1) / 2;
            sum -= (long)(x - (n - index - 1)) * (x - (n - index - 1) + 1) / 2;
            return sum <= maxSum;
        }
    }
}

