import java.util.*;

public class Solution {
    public int[] getBiggestThree(int[][] grid) {
        PriorityQueue<Integer> pq = new PriorityQueue<>((a, b) -> b - a);
        Set<Integer> set = new HashSet<>();

        for (int i = 0; i < grid.length; i++) {
            for (int j = 0; j < grid[0].length; j++) {
                set.add(grid[i][j]);
                int size = 1;
                while (i - size >= 0 && i + size < grid.length && j - size >= 0 && j + size < grid[0].length) {
                    int sum = grid[i][j] + grid[i - size][j] + grid[i + size][j] + grid[i][j - size] + grid[i][j + size];
                    for (int k = 1; k < size; k++) {
                        sum += grid[i - k][j - k] + grid[i - k][j + k] + grid[i + k][j - k] + grid[i + k][j + k];
                    }
                    set.add(sum);
                    size++;
                }
            }
        }

        int[] result = new int[Math.min(3, set.size())];
        int index = 0;
        for (Integer num : set) {
            if (index == 3) break;
            result[index++] = num;
        }
        Arrays.sort(result);
        reverseArray(result);
        return result;
    }

    private void reverseArray(int[] array) {
        int left = 0, right = array.length - 1;
        while (left < right) {
            int temp = array[left];
            array[left] = array[right];
            array[right] = temp;
            left++;
            right--;
        }
    }
}

