public class Solution {
    public int minSkips(int[] dist, int speed, int hoursBefore) {
        int n = dist.length;
        double[][] dp = new double[n + 1][n + 1];

        for (int i = 0; i <= n; i++) {
            for (int j = 0; j <= n; j++) {
                dp[i][j] = Double.POSITIVE_INFINITY;
            }
        }

        dp[0][0] = 0.0;

        for (int i = 1; i <= n; i++) {
            double time = (double) dist[i - 1] / speed;

            for (int j = 0; j <= i; j++) {
                if (dp[i - 1][j] != Double.POSITIVE_INFINITY) {
                    dp[i][j] = Math.ceil(dp[i - 1][j] + time);
                }

                if (j > 0 && dp[i - 1][j - 1] != Double.POSITIVE_INFINITY) {
                    dp[i][j] = Math.min(dp[i][j], dp[i - 1][j - 1] + time);
                }
            }
        }

        for (int j = 0; j <= n; j++) {
            if (dp[n][j] <= hoursBefore) {
                return j;
            }
        }

        return -1;
    }
}

