// #2022_05_09_Time_98_ms_(45.92%)_Space_128.3_MB_(32.65%)
import java.util.Arrays;

public class Solution {
    private static final int MOD = (int) 1e9 + 7;

    public int minWastedSpace(int[] packages, int[][] boxes) {
        Arrays.sort(packages);

        long totalPackagesSize = 0;
        for (int packageSize : packages) {
            totalPackagesSize += packageSize;
        }

        long minWaste = Long.MAX_VALUE;

        for (int[] boxSizes : boxes) {
            Arrays.sort(boxSizes);

            if (boxSizes[boxSizes.length - 1] < packages[packages.length - 1]) {
                continue; // Box of required size not present
            }

            long waste = 0;
            int prevIndex = -1;

            for (int boxSize : boxSizes) {
                int upperIndex = findUpperIndex(packages, boxSize);

                if (upperIndex == -1) {
                    continue; // No package can fit in this box
                }

                waste += (long) (boxSize * (upperIndex - prevIndex - 1)) - (totalPackagesSizeInRange(packages, prevIndex + 1, upperIndex));

                prevIndex = upperIndex;
            }

            if (prevIndex != packages.length - 1) {
                continue; // Not all packages can fit in the boxes
            }

            minWaste = Math.min(minWaste, waste);
        }

        return minWaste == Long.MAX_VALUE ? -1 : (int) (minWaste % MOD);
    }

    private int findUpperIndex(int[] packages, int boxSize) {
        int left = 0;
        int right = packages.length - 1;

        while (left <= right) {
            int mid = left + (right - left) / 2;

            if (packages[mid] > boxSize) {
                right = mid - 1;
            } else {
                left = mid + 1;
            }
        }

        return left == packages.length ? -1 : left - 1;
    }

