// #2022_05_03_Time_13_ms_(99.44%)_Space_78.1_MB_(33.15%)
public class Solution {
    public int minAbsoluteSumDiff(int[] nums1, int[] nums2) {
        final int MOD = (int) 1e9 + 7;
        int n = nums1.length;
        long sum = 0;
        for (int i = 0; i < n; i++) {
            sum += Math.abs(nums1[i] - nums2[i]);
        }

        long minDiff = sum;
        Arrays.sort(nums1);
        for (int i = 0; i < n; i++) {
            int left = 0, right = n - 1;
            while (left <= right) {
                int mid = left + (right - left) / 2;
                if (nums1[mid] >= nums2[i]) {
                    right = mid - 1;
                } else {
                    left = mid + 1;
                }
            }

            long diff = sum;
            if (left < n) {
                diff -= Math.abs(nums1[i] - nums2[i]);
                diff += Math.abs(nums1[left] - nums2[i]);
                minDiff = Math.min(minDiff, diff);
            }

            if (right >= 0) {
                diff = sum;
                diff -= Math.abs(nums1[i] - nums2[i]);
                diff += Math.abs(nums1[right] - nums2[i]);
                minDiff = Math.min(minDiff, diff);
            }
        }

        return (int) (minDiff % MOD);
    }
}

