        return dfs(nums, 0, 0);
    }

    private int dfs(int[] nums, int index, int currentXor) {
        if (index == nums.length) {
            return currentXor;
        }

        // include the current element
        int include = dfs(nums, index + 1, currentXor ^ nums[index]);

        // exclude the current element
