public class Solution {
    public int largestMagicSquare(int[][] grid) {
        int m = grid.length;
        int n = grid[0].length;

        // cumulative sum for each row
        int[][] rowSum = new int[m][n + 1];
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                rowSum[i][j + 1] = rowSum[i][j] + grid[i][j];
            }
        }

        // cumulative sum for each column
        int[][] colSum = new int[n][m + 1];
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < m; j++) {
                colSum[i][j + 1] = colSum[i][j] + grid[j][i];
            }
        }

        // start with the biggest side possible
        for (int k = Math.min(m, n); k >= 2; k--) {
            // check every square
            for (int i = 0; i <= m - k; i++) {
                for (int j = 0; j <= n - k; j++) {
                    if (isMagic(grid, rowSum, colSum, i, j, k)) {
                        return k;
                    }
                }
            }
        }

        // every 1 x 1 grid is trivially a magic square
        return 1;
    }

    private boolean isMagic(int[][] grid, int[][] rowSum, int[][] colSum, int i, int j, int k) {
        // check each row and column
        int target = getRowSum(rowSum, i, j, k);
        for (int x = i; x < i + k; x++) {
            if (getRowSum(rowSum, x, j, k) != target) {
                return false;
            }
        }

        for (int y = j; y < j + k; y++) {
            if (getColSum(colSum, y, i, k) != target) {
                return false;
            }
        }

        // checks both diagonals
        int diagonal1 = 0;
        int diagonal2 = 0;
        for (int x = 0; x < k; x++) {
            diagonal1 += grid[i + x][j + x];
            diagonal2 += grid[i + x][j + k - 1 - x];
        }

        return target == diagonal1 && target == diagonal2;
    }

    private int getRowSum(int[][] rowSum, int i, int j, int k) {
        return rowSum[i][j + k] - rowSum[i][j];
    }

    private int getColSum(int[][] colSum, int j, int i, int k) {
        return colSum[j][i + k] - colSum[j][i];
    }
}

