public class Solution {
    private static final int MOD = (int) 1e9 + 7;

    public int maxNiceDivisors(int primeFactors) {
        if (primeFactors == 1) return 1;
        if (primeFactors == 2) return 2;
        if (primeFactors == 3) return 4;

        long res = 1;
        if (primeFactors % 3 == 0) {
            for (int i = 0; i < primeFactors / 3; i++) {
                res = res * 4 % MOD;
            }
        } else if (primeFactors % 3 == 1) {
            for (int i = 0; i < primeFactors / 3 - 1; i++) {
                res = res * 4 % MOD;
            }
            res = res * 2 % MOD;
        } else {
            for (int i = 0; i < primeFactors / 3; i++) {
                res = res * 4 % MOD;
            }
            res = res * 2 % MOD;
        }

        return (int) res;
    }
}

