public class Solution {
    public int maximumRemovals(String s, String p, int[] removable) {
        int left = 0;
        int right = removable.length - 1;

        while (left <= right) {
            int mid = left + (right - left) / 2;

            // Create a copy of the string to avoid modifying the original
            char[] tempS = s.toCharArray();

            // Remove letters from 0 to mid by changing it into some other non-letters
            for (int i = 0; i <= mid; i++) {
                tempS[removable[i]] = '#';
            }

            if (isSubsequence(new String(tempS), p)) {
                left = mid + 1;
            } else {
                right = mid - 1;
            }
        }

        return left;
    }

    private boolean isSubsequence(String s, String p) {
        int i = 0;
        int j = 0;

        while (i < s.length() && j < p.length()) {
            if (s.charAt(i) == p.charAt(j)) {
                j++;
            }
            i++;
        }

        return j == p.length();
    }
}

