public class Solution {
    public int[] getMaximumXor(int[] nums, int maximumBit) {
        int n = nums.length;
        int[] answer = new int[n];

        // Calculate the prefix XOR sum
        int xorSum = 0;
        for (int num : nums) {
            xorSum ^= num;
        }

        // Perform queries and update the answer array
        for (int i = n - 1; i >= 0; i--) {
            // Find k that maximizes the XOR sum
            int k = (1 << maximumBit) - 1 ^ xorSum;

            // Update the answer array
            answer[i] = k;

            // Remove the last element from the current array nums
            if (i > 0) {
                xorSum ^= nums[i];
            }
        }

        return answer;
    }
}

