public class Solution {
    public boolean splitString(String s) {
        return backtrack(s, 0, new long[10], 0);
    }

    private boolean backtrack(String s, int index, long[] nums, int count) {
        if (index == s.length()) {
            return count >= 2;
        }

        for (int i = index; i < s.length(); i++) {
            String substr = s.substring(index, i + 1);
            if (substr.startsWith("0") && substr.length() > 1) {
                continue;
            }

            long num = Long.parseLong(substr);
            if (count == 0 || num == nums[count - 1] - 1) {
                nums[count++] = num;
                if (backtrack(s, i + 1, nums, count)) {
                    return true;
                }
                count--;
            }
        }

        return false;
    }
}

