import java.util.*;

public class Solution {
    public int largestPathValue(String colors, int[][] edges) {
        int n = colors.length();
        List<Integer>[] graph = new ArrayList[n];
        for (int i = 0; i < n; i++) {
            graph[i] = new ArrayList<>();
        }

        for (int[] edge : edges) {
            graph[edge[0]].add(edge[1]);
        }

        int[][] dp = new int[n][26];
        boolean[] visited = new boolean[n];
        boolean[] onPath = new boolean[n];

        int result = 0;
        for (int i = 0; i < n; i++) {
            if (!visited[i]) {
                if (!dfs(graph, colors, dp, visited, onPath, i)) {
                    return -1;
                }
            }
            result = Math.max(result, getMax(dp[i]));
        }

        return result;
    }

    private boolean dfs(List<Integer>[] graph, String colors, int[][] dp, boolean[] visited, boolean[] onPath, int node) {
        if (onPath[node]) {
            return false; // cycle detected
        }

        if (visited[node]) {
            return true;
        }

        visited[node] = true;
        onPath[node] = true;

        for (int neighbor : graph[node]) {
            if (!dfs(graph, colors, dp, visited, onPath, neighbor)) {
                return false; // cycle detected
            }

            updateDp(dp, node, neighbor, colors);
        }

        onPath[node] = false;

        return true;
    }

    private void updateDp(int[][] dp, int node, int neighbor, String colors) {
        for (int i = 0; i < 26; i++) {
            if (i == colors.charAt(node) - 'a') {
                dp[node][i] = Math.max(dp[neighbor][i], 1);
            } else {
                dp[node][i] = dp[neighbor][i];
            }
        }

        for (int i = 0; i < 26; i++) {
            if (dp[node][i] == 0) {
                dp[node][i] = dp[neighbor][i];
            }
        }
    }

    private int getMax(int[] arr) {
        int max = 0;
        for (int num : arr) {
            max = Math.max(max, num);
        }
        return max;
    }
}

