import java.util.LinkedList;
import java.util.Queue;

public class Solution {
    public int shortestPathAllKeys(String[] grid) {
        char[][] g = new char[grid.length][];
        for (int i = 0; i < grid.length; i++) {
            g[i] = grid[i].toCharArray();
        }

        int m = g.length;
        int n = g[0].length;
        int allKeys = 0;
        int[] start = new int[2];
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (g[i][j] == '@') {
                    start[0] = i;
                    start[1] = j;
                } else if (g[i][j] >= 'a' && g[i][j] <= 'f') {
                    allKeys |= 1 << (g[i][j] - 'a');
                }
            }
        }

        Queue<int[]> queue = new LinkedList<>();
        boolean[][][] visited = new boolean[m][n][64];
        queue.offer(new int[]{start[0], start[1], 0});
        visited[start[0]][start[1]][0] = true;
        int step = 0;

        while (!queue.isEmpty()) {
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                int[] cur = queue.poll();
                if (cur[2] == allKeys) return step;

                int[][] dirs = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};
                for (int[] dir : dirs) {
                    int x = cur[0] + dir[0];
                    int y = cur[1] + dir[1];

                    if (x < 0 || x >= m || y < 0 || y >= n || g[x][y] == '#') continue;

                    int newState = cur[2];
                    if (g[x][y] >= 'a' && g[x][y] <= 'f') {
                        newState |= 1 << (g[x][y] - 'a');
                    } else if (g[x][y] >= 'A' && g[x][y] <= 'F') {
                        if ((cur[2] >> (g[x][y] - 'A')) % 2 == 0) continue;
                    }

                    if (!visited[x][y][newState]) {
                        queue.offer(new int[]{x, y, newState});
                        visited[x][y][newState] = true;
                    }
                }
            }
            step++;
        }

        return -1;
    }
}

