import java.util.ArrayList;
import java.util.List;

public class Solution {
    public List<Integer> splitIntoFibonacci(String num) {
        List<Integer> result = new ArrayList<>();
        backtrack(result, num, 0);
        return result;
    }

    private boolean backtrack(List<Integer> list, String s, int start) {
        if (start == s.length() && list.size() >= 3) {
            return true;
        }
        for (int end = start + 1; end <= s.length(); end++) {
            String subStr = s.substring(start, end);
            if (subStr.length() > 1 && subStr.startsWith("0")) {
                continue;
            }
            long num = Long.parseLong(subStr);
            if (num > Integer.MAX_VALUE) {
                continue;
            }
            int size = list.size();
            if (size >= 2 && num > list.get(size - 1) + list.get(size - 2)) {
                continue;
            }
            if (size <= 1 || num == list.get(size - 1) + list.get(size - 2)) {
                list.add((int) num);
                if (backtrack(list, s, end)) {
                    return true;
                }
                list.remove(list.size() - 1);
            }
        }
        return false;
    }
}

