        // Iterate over each word in the paragraph
        for (String word : words) {
            // Remove punctuation from the word
            String cleanWord = word.replaceAll("[^a-zA-Z]", "");

            // If the word is not banned and not empty, increment its count
            if (!bannedSet.contains(cleanWord) && !cleanWord.isEmpty()) {
                wordCount.put(cleanWord, wordCount.getOrDefault(cleanWord, 0) + 1);
            }
        }

        // Find the most common word
        String mostCommon = Collections.max(wordCount.entrySet(), Comparator.comparingInt(Map.Entry::getValue)).getKey();

        return mostCommon;
    }
}

