import java.util.Arrays;

public class Solution {
    public boolean splitArraySameAverage(int[] nums) {
        int n = nums.length;
        if (n == 1) return false;

        int sum = 0;
        for (int num : nums) {
            sum += num;
        }

        for (int mask = 1; mask < (1 << n); mask++) {
            int count = Integer.bitCount(mask);
            int currSum = 0;
            for (int i = 0; i < n; i++) {
                if ((mask & (1 << i)) != 0) {
                    currSum += nums[i];
                }
            }

            if (currSum * (n - count) == (sum - currSum) * count && count > 0 && count < n) {
                return true;
            }
        }

        return false;
    }
}

