public class Solution {
    public double largestSumOfAverages(int[] nums, int k) {
        int n = nums.length;
        double[][] dp = new double[n + 1][k + 1];

        // Calculate prefix sum for efficient calculation of subarray average
        int[] prefixSum = new int[n + 1];
        for (int i = 0; i < n; i++) {
            prefixSum[i + 1] = prefixSum[i] + nums[i];
        }

        // Initialize base case where k is 1
        for (int i = 1; i <= n; i++) {
            dp[i][1] = (double) prefixSum[i] / i;
        }

        // Fill up the dp table in a bottom-up manner
        for (int j = 2; j <= k; j++) {
            for (int i = j; i <= n; i++) {
                for (int x = j - 1; x < i; x++) {
                    double average = (double) (prefixSum[i] - prefixSum[x]) / (i - x);
                    dp[i][j] = Math.max(dp[i][j], dp[x][j - 1] + average);
                }
            }
        }

        return dp[n][k];
    }
}

