import java.util.LinkedList;
import java.util.Queue;

public class Solution {
    public int racecar(int target) {
        Queue<int[]> queue = new LinkedList<>();
        boolean[][] visited = new boolean[2001][10001];

        queue.offer(new int[] {0, 1});
        visited[0][1] = true;
        int steps = 0;

        while (!queue.isEmpty()) {
            int size = queue.size();

            for (int i = 0; i < size; i++) {
                int[] current = queue.poll();
                int position = current[0];
                int speed = current[1];

                if (position == target) return steps;

                // Accelerate
                int newPosition = position + speed;
                int newSpeed = speed * 2;

                if (newPosition >= -10000 && newPosition <= 10000 && !visited[newPosition][newSpeed]) {
                    queue.offer(new int[] {newPosition, newSpeed});
                    visited[newPosition][newSpeed] = true;
                }

                // Reverse
                if (speed > 0) {
                    newSpeed = -1;
                } else {
                    newSpeed = 1;
                }

                if (!visited[position][newSpeed]) {
                    queue.offer(new int[] {position, newSpeed});
                    visited[position][newSpeed] = true;
                }
            }

            steps++;
        }

        return -1; // This line should never be reached
    }
}

