// #2022_03_28_Time_1_ms_(91.04%)_Space_43.3_MB_(78.11%)
import com_github_leetcode.TreeNode;

public class Solution {
    public TreeNode constructFromPrePost(int[] preorder, int[] postorder) {
        return construct(preorder, 0, preorder.length - 1, postorder, 0, postorder.length - 1);
    }

    private TreeNode construct(int[] preorder, int preStart, int preEnd, int[] postorder, int postStart, int postEnd) {
        if (preStart > preEnd || postStart > postEnd) return null;

        TreeNode root = new TreeNode(preorder[preStart]);

        if (preStart == preEnd) return root;

        int leftVal = preorder[preStart + 1];
        int leftIndex = find(postorder, postStart, postEnd, leftVal);

        int leftSize = leftIndex - postStart + 1;

        root.left = construct(preorder, preStart + 1, preStart + leftSize, postorder, postStart, leftIndex);
        root.right = construct(preorder, preStart + leftSize + 1, preEnd, postorder, leftIndex + 1, postEnd - 1);

        return root;
    }

    private int find(int[] arr, int start, int end, int target) {
        for (int i = start; i <= end; i++) {
            if (arr[i] == target) return i;
        }
        return -1;
    }
}

