public class Solution {
    public int numBusesToDestination(int[][] routes, int source, int target) {
        if (source == target) return 0;

        int n = routes.length;
        List<Set<Integer>> stops = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            Set<Integer> set = new HashSet<>();
            for (int stop : routes[i]) {
                set.add(stop);
            }
            stops.add(set);
        }

        Queue<int[]> queue = new ArrayDeque<>();
        boolean[] visited = new boolean[n];

        for (int i = 0; i < n; i++) {
            if (stops.get(i).contains(source)) {
                queue.offer(new int[] {i, 1});
                visited[i] = true;
            }
        }

        while (!queue.isEmpty()) {
            int[] curr = queue.poll();
            int bus = curr[0];
            int count = curr[1];

            for (int i = 0; i < n; i++) {
                if (!visited[i] && !stops.get(bus).isEmpty() && stops.get(i).stream().anyMatch(stops.get(bus)::contains)) {
                    visited[i] = true;
                    if (stops.get(i).contains(target)) return count + 1;
                    queue.offer(new int[] {i, count + 1});
                }
            }
        }

        return -1;
    }
}

