import java.util.Arrays;
import java.util.Comparator;
import java.util.PriorityQueue;

public class Solution {
    public double mincostToHireWorkers(int[] quality, int[] wage, int k) {
        Worker[] workers = new Worker[quality.length];
        for (int i = 0; i < quality.length; i++) {
            workers[i] = new Worker(wage[i], quality[i]);
        }

        Arrays.sort(workers, Comparator.comparingDouble(o -> o.ratio));

        PriorityQueue<Integer> pq = new PriorityQueue<>((a, b) -> b - a);
        double totalQuality = 0;
        double minCost = Double.MAX_VALUE;

        for (Worker worker : workers) {
            pq.offer(worker.quality);
            totalQuality += worker.quality;

            if (pq.size() > k) {
                totalQuality -= pq.poll();
            }

            if (pq.size() == k) {
                minCost = Math.min(minCost, totalQuality * worker.ratio);
            }
        }

        return minCost;
    }

    private static class Worker {
        double ratio;
        int quality;

        public Worker(int wage, int quality) {
            this.ratio = (double) wage / quality;
            this.quality = quality;
        }
    }
}

