import java.util.ArrayDeque;
import java.util.Queue;

public class Solution {
    public int shortestPathLength(int[][] graph) {
        int n = graph.length;
        int allVisited = (1 << n) - 1;
        Queue<int[]> queue = new ArrayDeque<>();

        // Initialize the queue with all nodes as starting points
        for (int i = 0; i < n; i++) {
            queue.offer(new int[] {i, 1 << i, 0});
        }

        boolean[][] visited = new boolean[n][1 << n];

        while (!queue.isEmpty()) {
            int[] current = queue.poll();
            int node = current[0], state = current[1], steps = current[2];

            // If we have visited all nodes, return the number of steps
            if (state == allVisited) {
                return steps;
            }

            // Mark the current state as visited
            visited[node][state] = true;

            // Explore all neighbors of the current node
            for (int neighbor : graph[node]) {
                int newState = state | (1 << neighbor);

                // If we haven't visited this state before, add it to the queue
                if (!visited[neighbor][newState]) {
                    queue.offer(new int[] {neighbor, newState, steps + 1});
                }
            }
        }

        return -1; // This should not happen for a connected graph
    }
}

