public class Solution {
    public int sumSubseqWidths(int[] nums) {
        Arrays.sort(nums);
        final int MOD = (int) 1e9 + 7;
        long res = 0, pow2 = 1;

        for (int j = 0; j < nums.length; j++) {
            res = (res + (nums[j] * pow2 - nums[nums.length - 1 - j] * pow2)) % MOD;
            pow2 = pow2 * 2 % MOD;
