// #2022_03_23_Time_28_ms_(80.54%)_Space_42.6_MB_(79.87%)
import java.util.Arrays;
import java.util.HashMap;
import java.util.Map;

public class Solution {
    private static final int MOD = (int) 1e9 + 7;

    public int numFactoredBinaryTrees(int[] arr) {
        Arrays.sort(arr);
        Map<Integer, Long> memo = new HashMap<>();

        long result = 0;
        for (int i = 0; i < arr.length; i++) {
            result = (result + dfs(arr[i], arr, memo)) % MOD;
        }

        return (int) result;
    }

    private long dfs(int x, int[] arr, Map<Integer, Long> memo) {
        if (memo.containsKey(x)) {
            return memo.get(x);
        }

        long count = 1;
        for (int i = 0; i < arr.length; i++) {
            if (arr[i] > x) {
                break;
            }
            if (x % arr[i] == 0) {
                int quotient = x / arr[i];
                if (Arrays.binarySearch(arr, quotient) >= 0) {
                    count = (count + dfs(arr[i], arr, memo) * dfs(quotient, arr, memo)) % MOD;
                }
            }
        }

        memo.put(x, count);
        return count;
    }
}

